			<div class=""floatleft""><a href=""/w/File:Torch_(unobtainable_item)_detail.png"" class=""image""><img alt=""Torch (unobtainable item) detail.png"" src=""/images/thumb/Torch_%28unobtainable_item%29_detail.png/100px-Torch_%28unobtainable_item%29_detail.png?ef9b1"" decoding=""async"" width=""100"" height=""185"" srcset=""/images/thumb/Torch_%28unobtainable_item%29_detail.png/150px-Torch_%28unobtainable_item%29_detail.png?ef9b1 1.5x, /images/thumb/Torch_%28unobtainable_item%29_detail.png/200px-Torch_%28unobtainable_item%29_detail.png?ef9b1 2x"" data-file-width=""827"" data-file-height=""1530"" /></a></div>
			<p>A <b>Torch</b> is an unobtainable version of the <a href=""/w/Lit_torch"" class=""mw-redirect"" title=""Lit torch"">Lit torch</a>. Torches were previously tradeable and could be turned into banknotes. However, they were made untradeable due to an unfixable bug where trading a lit torch in a dark area would not update the lighting for either player.<sup id=""cite_ref-1"" class=""reference""><a href=""#cite_note-1"">&#91;1&#93;</a></sup> Any player who had a noted lit torch was given this now discontinued item. Originally, the item was identical to the real lit torch, except being stackable. 
			</p><p>As this change occurred prior to August 2007, the item has never been obtainable in Old School RuneScape.
			</p>
